import './DragonBase.css'
import leftArrow from './left-arrow.png'
import rightArrow from './right-arrow.png'
import React from 'react';
import BootstrapTable from 'react-bootstrap-table-next';

const headers = [{
  dataField: 'id',
  text:'ID'},{
  dataField:'name',
  text:'ИМЯ'},{
  dataField:'age',
  text:'ВОЗРАСТ'},{
  dataField:'weight',
  text:'ВЕС'},{
  dataField:'character',
  text:'ХАРАКТЕР'},{
  dataField:'type',
  text:'ТИП'},{
  dataField:'x',
  text:'Х'},{
  dataField:'y',
  text:'У'},{
  dataField:'cave',
  text:'ГЛУБИНА ПЕЩЕРЫ'},{
  dataField:'treasure',
  text:'КОЛИЧЕСТВО СОКРОВИЩ'}
];


const rows = [
{id:'1',name: 'Балерион',age: '208',weight: '10',character:'Хаос',type:'Огненный',x:'12',y:'4',cave:'1400',treasure:'157'},
{id:'2',name: 'Вхагар',age: '181',weight: '18',character:'Хаос',type:'Огненный',x:'12',y:'4',cave:'1400',treasure:'157'},
{id:'3',name: 'Мераксес',age:'181',weight: '18',character:'Хаос',type:'Огненный',x:'12',y:'4',cave:'1400',treasure:'157'},
{id:'4',name: 'Мераксес',age:'181',weight: '18',character:'Хаос',type:'Огненный',x:'12',y:'4',cave:'1400',treasure:'157'},
{id:'5',name: 'Мераксес',age:'181',weight: '18',character:'Хаос',type:'Огненный',x:'12',Y:'4',cave:'1400',treasure:'157'}
];

class DragonBase extends React.Component {
  render() {
    return (
      <BootstrapTable  
      keyField='id' data={ rows } columns={ headers }
      />
    );
  }
}


export default DragonBase;
